<node ID="83632CA9-FF36-4A31-8D6F-180DC6D646E7" TEXT="Scope" COLOR="#063533" POSITION="left" STYLE="fork"><edge COLOR="#B2D39F" WIDTH="6" /><font NAME="STHeitiSC-Light" SIZE="14" /><linktarget ID="Arrow_ID_E42FC857-5269-4B1B-B135-03311934D004_83632CA9-FF36-4A31-8D6F-180DC6D646E7" STARTARROW="None" COLOR="#1C896A" SOURCE="E42FC857-5269-4B1B-B135-03311934D004" ENDARROW="Default" /><node ID="6C96A5FE-BEFC-44C6-886F-77DCE871B262" TEXT="Closure" COLOR="#063533" POSITION="left" STYLE="fork"><edge COLOR="#B2D39F" WIDTH="5" /><font NAME="STHeitiSC-Light" SIZE="14" /><node ID="1CA778CF-AA3B-44FC-AEE2-6CA85DAC362C" TEXT="   +-------------------+      +-----------------+
